import "./App.css";
import "./Page2.css";

function Pages2() {
  return (
    <div className="app">
      <div className="bg">
        <span>
          <span className="headtext">UPBEAT</span>
        </span>
        <div class="text">Pages2</div>
      </div>
    </div>
  );
}

export default Pages2;
